0e7\u00e3o, e, quanto maior for o horizonte de predi\u00e7\u00e3o, maior ser\u00e1 o erro associado. Outro fator importante a ser considerado aqui \u00e9 que todos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"118518","type":"Paragraph"},{"attributes":{"label":{"value":"60% do valor Normal"},"renderers":[{"id":"118484"}]},"id":"118512","type":"LegendItem"},{"attributes":{"items":[{"id":"118259"},{"id":"118292"},{"id":"118322"},{"id":"118354"}],"location":"top_left"},"id":"118258","type":"Legend"},{"attributes":{"active_drag":"auto","active_inspect":"auto","active_multi":null,"active_scroll":"auto","active_tap":"auto","tools":[{"id":"118379"},{"id":"118380"},{"id":"118381"},{"id":"118382"},{"id":"118383"},{"id":"118384"},{"id":"118514"}]},"id":"118386","type":"Toolbar"},{"attributes":{"line_alpha":0.1,"line_color":"#3288bd","line_width":2,"x":{"field":"x"},"y":{"field":"y"}},"id":"118395","type":"Line"},{"attributes":{"source":{"id":"118393"}},"id":"118397","type":"CDSView"},{"attributes":{"ticks":[1587254400000.0,1587859200000.0,1588464000000.0,1589068800000.0,1589673600000.0,1590278400000.0,1590883200000.0,1591488000000.0,1592092800000.0,1592697600000.0]},"id":"118516","type":"FixedTicker"},{"attributes":{"line_alpha":0.6,"line_color":"#fb9a99","line_width":1.5,"x":{"field":"x"},"y":{"field":"y"}},"id":"118482","type":"Line"},{"attributes":{"below":[{"id":"118371"}],"center":[{"id":"118374"},{"id":"118378"},{"id":"118416"},{"id":"118513"}],"l
